import React from 'react'
import "./topbar.css"

export default function TopBar() {
  return (
    <div className="top">
        <div className="topLeft">
        <i class="fa-brands fa-facebook"></i>
        </div>
        <div className="topCenter">Center</div>
        <div className="topRight">Right</div>
    </div>
  )
}
